  \"2016-07-27T23:04:56.642727\",\n\t\"name\": \"agricultural-crop-production-and-utilization-study-wheeler-national-wildlife-refuge-progre\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objectives of this study are
  as follows: 1. To determine the total amount of hot foods (corn, soybeans, and grain
  sorghum) produced for waterfowl on the Wheeler Refuge, 2. To determine the seasonal
  availability of hot foods to waterfowl, 3. To ascertain the degree of total use
  of hot foods, 4. To determine if a relationship exists between the availability
  of food in given fields and waterfowl movements into and through the southern approach
  to the new Huntsville-Madison Jetport. Procedures, methods, and results are discussed.
  Datasets are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
